    - "    * You can read minds?!?!?!\n\n    * I'm pretty sure there's more to life than being really, really ridiculously good looking, and I plan on finding out what that is.\n\n    * The original Greek word \"model\" means \"misshapen ball of clay\", and I try to think about that every time I go in front of the camera.\n\n    * Moisture is the essence of wetness, and wetness is the essence of beauty.\n\n    * Have you ever wondered if there was more to life, other than being really, really, ridiculously good looking?\n\n    * I'm not an ambi-turner.\n\n    * I think I'm getting the black lung, Pop. It's not very well ventilated down there.\n\n    * But why male models?\n\n    * [Derek sees his reflection in a puddle] Who am I? [the reflection speaks back] I don't know.\n\n    * Wait a minute. I might just have an idea. They'll be looking for us at Maury's right? But they won't be looking for... not us.\n\n    * There was a moment last night, when she was sandwiched between the two Finnish dwarves and the Maori tribesmen, where I thought, \"Wow, I could really spend the rest of my life with this woman.\"\n\n    * Do you understand that the world does not revolve around you and your \"do whatever it takes, ruin as many people's lives, so long as you can make a name for yourself as an investigatory journalist, no matter how many friends you lose or people you leave dead and bloodied along the way, just so long so you can make a name for yourself as an investigatory journalist, no matter how many friends you lose or people you leave dead and bloodied and dying along the way\"?...\n\n    * Rufus, Brint, and Meekus were like brothers to me. And when I say brother, I don't mean, like, an actual brother, but I mean it like the way black people use it. Which is more meaningful, I think.\n\n    * If there is anything that this horrible tragedy can teach us, it's that a male model's life is a precious, precious commodity. Just because we have chiselled abs and stunning features, it doesn't mean that we too can't not die in a freak gasoline fight accident.\n\n    * You think that you're too cool for school, but I have a newsflash for you, Walter Cronkite... you aren't.\n\n    * Now if you'll excuse me, I have an after-funeral party to attend.\n\n    * At the Derek Zoolander Center For Children Who Can't Read Good And Wanna Learn To Do Other Stuff Good Too, we teach you that there's more to life than being really, really good looking.\n\n    * I can Dere-lick my own balls, thank you very much.\n\n    * Mer-man! *keh... keh... keh...* MER-MAN!\n\n    * [Cellphone rings] God?\n\n    * [Upon seeing the model of the \"Derek Zoolander Center For Children Who Can't Read Good And Wanna Learn To Do Other Stuff Good Too] What is this, a center for ants? How can we be expected to teach children to learn how to read if they can't even fit inside the building? The center has to be at least... three times bigger than this!\n\n    * SNAP\n\n    * Words can only hurt you if you try to read them. Don't play their game.\n\n    * I was at a day spa. DAY. D-a-i-y-e.\n\n    * Just thinking about it was the most rewarding experience of my life.\n\n    * A week? What, are you having a whack attack? I saw you this afternoon, dum-dum.\n\n    * Shut your hole Zane!\n"
